import React from 'react'
import { menu_list } from '../assets/frontend_assets/assets'

const HorizontalScrollCard = () => {
  return (
    <div className='flex justify-between gap-5 flex-nowrap items-center overflow-x-scroll' >
      {
        menu_list.map((menu) => {
            return (
            <div>
                <img src={menu.menu_image} />
                <div className='text-center' >{menu.menu_name}</div>
            </div>
            )
        })
      }
    </div>
  )
}

export default HorizontalScrollCard
